‚†Ä
The amount of time we spend sitting down in front of our screens has increased substantially over the past decade and we are no longer as active as we used to be. For this reason, many of us have developed an anterior pelvic tilt of the pelvis which can make us look like we have a belly when we don‚Äôt, and even worse it is a common source of lower back pain.‚†Ä
‚†Ä
While there are several known causes of an anterior tilt of the pelvis ‚Äì such as injury to or overuse of the hamstrings, glutes, hip flexors, and hip extensors ‚Äì the most likely culprit is a sedentary lifestyle and too much sitting. Sitting for prolonged periods of time without proper lumbar support causes the hip flexors to tighten and shorten, thereby drawing the pelvis forward.‚†Ä
‚†Ä
Here‚Äôs a summary of the muscular imbalances of an anterior pelvic tilt:‚†Ä
‚Ä¢	Tight hip flexors‚†Ä
‚Ä¢	Tight quads/thighs‚†Ä
‚Ä¢	Tight lower back‚†Ä
‚Ä¢	Weak glutes‚†Ä
‚Ä¢	Weak hamstrings‚†Ä
‚Ä¢	Weak core‚†Ä
‚†Ä
It is important to note that some degree of anterior pelvic tilt is normal; in fact, research indicates that as many as 75 to 85 per cent of adults exhibit an anterior pelvic tilt with no noticeable symptoms.‚†Ä
‚†Ä
What Are The Symptoms of anterior pelvic tilt?‚†Ä
Aside from the muscular imbalances described above, there can be other symptoms associated with an anterior pelvic tilt.‚†Ä
Most people with mild to moderate pelvic anterior tilt will not notice any pain, discomfort, or decreased range of motion.‚†Ä
‚†Ä
If left untreated, however, severe cases of anterior pelvic tilt can increase the amount of pressure placed on the vertebrae of the lower spine, leading to symptoms such as:‚†Ä
‚Ä¢	Low back pain ‚†Ä
‚Ä¢	Groin pain ‚†Ä
‚Ä¢	Muscle stiffness‚†Ä
‚Ä¢	Postural changes ‚†Ä
‚†Ä
The good news is an anterior pelvic tilt can be fixed through corrective exercises and stretches. You need to reverse all the muscle imbalances it has caused. Here‚Äôs a quick summary of what to do:‚†Ä
‚Ä¢	Release and stretch the tight hip flexors‚†Ä
‚Ä¢	Release and stretch the quads/thighs‚†Ä
‚Ä¢	Stretch the lower back‚†Ä
‚Ä¢	Strengthen the glutes‚†Ä
‚Ä¢	Strengthen the hamstrings‚†Ä
‚Ä¢	Strengthen the core‚†Ä
‚†Ä
