‚Å†‚†Ä
Both have great health benefits in the right amounts. If you‚Äôre not great at metabolizing caffeine or coffee gives you jitters, I‚Äôd recommend going with green tea on a regular basis. Another work around if you want to try a lower-caffeine coffee or with something like matcha (which is somewhat like a concentrated green tea).‚Å†‚†Ä
‚Å†‚†Ä
Some more info on coffee & green tea below:‚Å†‚†Ä
‚Å†‚†Ä
Both have caffeine which blocks an inhibitory neurotransmitter in your brain which causes a stimulant effect. This boosts energy levels, improves mood & various brain functions.‚Å†‚†Ä
‚Å†‚†Ä
Having caffeine before your workout has been shown in studies to boost workout performance.‚Å†‚†Ä
‚Å†‚†Ä
Coffee also contains B vitamins, manganese, potassium and antioxidants. Try to stick with organic coffee when you can because coffee is often very heavily sprayed with pesticides.‚Å†‚†Ä
‚Å†‚†Ä
In two large studies, drinking coffee was correlated with a 20% reduced risk of early death in men and a 26% decreased risk of early death in women (1).‚Å†‚†Ä
‚Å†‚†Ä
Green tea contains 30% polyphenols by weight, including a high amount of catechins. Catechins are a type of antioxidant and is tied to reduced risk of cancer, heart attack, & other diseases.‚Å†‚†Ä
‚Å†‚†Ä
Green tea also contains L-theanine which works synergistically with caffeine to improve brain function.‚Å†‚†Ä
‚Å†‚†Ä
Which ever you preference you can still overdo it on caffeine - so be careful not to have too much of a good thing! I personally like to have coffee in the morning and green tea in the early afternoon.‚Å†‚†Ä
‚Å†‚†Ä
